execution.script:
pipeline {
    agent {label "dev"}
    tools {
        maven "MAVEN"
    }

    stages {


        stage("Build eHealth patient warning"){
            steps{
                build 'PatientApiJavaWrnings'
            }
         }

        stage("Build") {
            steps {
                echo "Build Started"
                
                sh 'sudo chmod -R 777 mvnw' 

                sh 'sudo ./mvnw compile'

                echo "Build Finished"
            }
        }


        stage("Package") {
            steps {
                echo "Packaging Started"

                sh 'sudo chmod -R 777 mvnw'

                sh 'sudo ./mvnw package'

                echo "Packaging Finished"
            }
        }

        // stage("Stop running containers and remove images"){
        //     steps{

        //         sh 'docker stop patientdb'

        //         sh 'docker rm patientdb'

        //         sh 'docker rmi ddragueur/ehealth:patientdb -f'

        //         sh 'docker stop patientapi'

        //         sh 'docker rm patientapi'

        //         sh 'docker rmi ddragueur/ehealth:patient -f'

        //     }
        // }


        stage("Docker build") {
            steps {
                echo "Buidling Patient API Java docker image"

                sh 'sudo docker build -t ddragueur/ehealth:patient .'

                echo "Buidling Patient API Java docker image Finished"
            }
        }

        stage("Docker hub push image") {
            steps {
                withCredentials([usernamePassword( credentialsId: 'DockerCredentials', usernameVariable: 'USERNAME', passwordVariable: 'PASSWORD')]) {

                    echo "Pushing Patient API Java docker image"

                    sh 'sudo docker login -u ${USERNAME} -p ${PASSWORD}'

                    sh 'sudo docker push ddragueur/ehealth:patient'

                    echo "Pushing Patient API Java docker image Finished"
                }
            }
        }

         stage("Deploy ehealth on Uat") {
             agent {label "uat"}
             steps {
                echo "Deploying ehealth on UAT"
                        
                //sh 'docker rm -v -f $(docker ps -qa)'

                sh 'sudo docker compose up -d'

                echo "Deploying ehealth on UAT Finished"
             }
         }

         stage("Prod kubernetes deployment of ehealth") {
             agent {label "prod"}
             steps {
                echo "Prod kubernetes deployment of ehealth"
                        
                sh 'kubectl apply -f /home/azureuser/ehealth/.'

                echo "Prod kubernetes deployment of ehealth Finished"
             }
         }

         stage("JMeter"){
            steps{
                build 'jmeterreport'
            }
         }


        // stage('Sonarqube Scan') {
